}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 48 48">  <g>    <polygon points="3 15 7 15 7 7 15 7 15 3 3 3 3 15" fill="#fff"/>    <polygon points="41 41 33 41 33 45 45 45 45 33 41 33 41 41" fill="#fff"/>    <polygon points="7 33 3 33 3 45 15 45 15 41 7 41 7 33" fill="#fff"/>    <polygon points="33 3 33 7 41 7 41 15 45 15 45 3 33 3" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
